,3,NULL,'O novo site do condomínio foi publicado. A partir de agora postaremos todas as fotos dos eventos lá. Confira.','upload/mensagens/e5beafab4e0577ae30b199e9b8670f84.jpg','2020-10-16 11:24:24','Site do condomínio'),(1641,6,NULL,'Venha prestigiar com a família esta festa tradicional do condomínio. Haverão palestras, workshops e apresentações das crianças. O evento acontecerá no domingo 12/05, a partir das 9h, no Salão de festas','upload/mensagens/3bd69b64b97c172d6c100887f4baaa9c.jpg','2020-10-16 11:25:00','Dia das mães no condomínio'),(1642,1,NULL,'Moradores, façam o cadastro de seus pets na administração. Isso ajuda na identificação de animais desaparecidos ou envolvidos em acidentes dentro do condomínio.','upload/mensagens/bb79cf8e2155e40875ff5bb9fc2d5a97.jpg','2020-10-16 11:25:30','Cadastro de pets'),(1643,2,1,'Fernanda Silva acabou de entrar.A liberação foi feita antecipadamente via aplicativo por Suporte Uzer. Caso não reconheça essa entrada, comunique a administração.',NULL,'2020-10-16 17:21:22','O visitante entrou.'),(1644,2,3,'Fernanda Silva acabou de entrar.A liberação foi feita antecipadamente via aplicativo por Suporte Uzer. Caso não reconheça essa entrada, comunique a administração.',NULL,'2020-10-16 17:21:23','O visitante entrou.'),(1645,2,4,'Fernanda Silva acabou de entrar.A liberação foi feita antecipadamente via aplicativo por Suporte Uzer. Caso não reconheça essa entrada, comunique a administração.',NULL,'2020-10-16 17:21:24','O visitante entrou.'),(1646,2,1,'Fernanda Silva acabou de sair.',NULL,'2020-10-16 17:21:37','O visitante saiu.'),(1647,2,3,'Fernanda Silva acabou de sair.',NULL,'2020-10-16 17:21:37','O visitante saiu.'),(1648,2,4,'Fernanda Silva acabou de sair.',NULL,'2020-10-16 17:21:38','O visitante saiu.'),(1649,2,1,'Cleunice Almeida acabou de entrar.A liberação foi feita antecipadamente via aplicativo por Suporte Uzer. Caso não reconheça essa entrada, comunique a administração.',NULL,'2020-10-16 17:22:07','O visitante entrou.'),(1650,